import React, { Component } from 'react'
import { Table , Button } from 'antd';

function Home () {
  const columns = [
    {
      title: '姓名',
      dataIndex: 'name',
      key: 'name'
    },
    {
      title: '年龄',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: '地址',
      dataIndex: 'address',
      key: 'address',
    },
    {
      title: 'Action',
      key: 'action',
      render: (text, record) => (
        <span>
          <Button>添加</Button>
          <Button>编辑</Button>
          <Button>删除</Button>
        </span>
      ),
    },
  ];
  const data = [
    {
      key: '1',
      name: 'John Brown',
      age: 32,
      address: 'New York No. 1 Lake Park',
      tags: ['nice', 'developer'],
    }
  ];
  return (
    <div className="tables"> 
      <Table columns={columns} dataSource={data} />
    </div>
  )

}
